import React, { Component } from "react"
import ComedianProfile from "../Components/ComedianProfile"
import { Route } from "react-router-dom"

function ComediansContainer (props) {

    const renderComedians = props.api.map(comic => <ComedianProfile key={comic.id} id={comic.id} name={comic.name} website={comic.personal_website} headshot={comic.headshot} city={comic.city}/> )
    return(
        <>
        <h1>Comedians Container</h1>
        <Route path="comedians" render={() => {
            return (
                { renderComedians }
            )
        }}/>


        </>

    )
}

export default ComediansContainer
